import { useEffect } from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();
  const userId = localStorage.getItem("user_id");
  const username = localStorage.getItem("username");

  useEffect(() => {
    if (!userId) {
      navigate("/login"); // Redirect to login if not authenticated
    }
  }, [userId, navigate]);

  const handleLogout = () => {
    localStorage.clear();
    navigate("/login");
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white flex flex-col items-center">
      {/* Navbar */}
      <nav className="bg-gray-800 w-full p-4 flex justify-between items-center">
        <h1 className="text-2xl font-bold">Crypto Dashboard</h1>
        <button
          onClick={handleLogout}
          className="bg-red-500 hover:bg-red-600 px-4 py-2 rounded-lg"
        >
          Logout
        </button>
      </nav>

      {/* Welcome Message */}
      <div className="mt-10 text-center">
        <h2 className="text-3xl font-bold">Welcome, {username || "User"}!</h2>
        <p className="text-gray-400 mt-2">Manage your cryptocurrency wallets.</p>
      </div>

      {/* Wallets Button */}
      <div className="bg-gray-800 p-6 mt-6 rounded-xl shadow-lg w-96 text-center">
        <h3 className="text-xl font-semibold">Your Wallets</h3>
        <button
          onClick={() => navigate("/wallets")}
          className="mt-4 bg-blue-500 hover:bg-blue-600 text-white px-6 py-3 rounded-lg"
        >
          View Wallets
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
